colors = function(){

    var minTemp = -25;
    var maxTemp = 35;

    //var color = d3.scale.linear().domain([minTemp,maxTemp+1]).range(['blue', 'red']);

    var to_c = function(f){ return (f-32)/1.8;}

    var colours = ["#6363FF", "#6373FF", "#63A3FF", "#63E3FF", "#63FFFB",
                   "#63FF9B", "#63FF6B", "#DBFF63", "#FBFF63",
                   "#FFD363", "#FFB363", "#FF8363", "#FF7363", "#FF6364"];


    var colours = ["#6363FF", "#63E3FF", "#63FFFB",
                   "#FFD363", "#FF6364", '#FF0000'];

    var heatmapColour = d3.scale.linear()
        .domain(d3.range(0, 1, 1.0 / (colours.length - 1)))
        .range(colours);

    // dynamic bit...
    var c = d3.scale.linear().domain([minTemp,maxTemp+1]).range([0,1]);

    var size = 4;

    var svg = d3.select("body").selectAll("svg")
        .data(all)
        .enter()
        .append("svg")
        .attr("class", "svg")
        .attr("width", 2000)
        .attr("height", 200);

    svg.append('text')
        .attr("transform", "translate(10, 20)")
        .text(function(d){ console.log(d); return d.location })

    var days = svg.selectAll(".day")
        .data(function(d){ return d.data})
        .enter()
        .append("g")
        .attr("transform", function(d, i){ return "translate(" + i*size + "," + 40 + ")"});

    var hours = days.selectAll("rect")
        .data(function (d) { return d; })
        .enter()
        .append("rect")
        .attr("width", size)
        .attr("height", size)
        .attr("x", 0)
        .attr("y", function(d, i) { return i * size; })
        .attr("fill", function(d){return heatmapColour(c(to_c(d)));})
        .text(function(d){return to_c(d)})


    // Legend

    for (var i=minTemp; i<maxTemp+1; i++){
        svg.append("rect")
            .attr("x", 10*(i+25) + 5)
            .attr("y", 140)
            .attr("width", 10)
            .attr("height", 20)
            .style("fill", heatmapColour(c(i)));

        if (i % 5 == 0){
            svg.append("text")
                .attr("transform", "translate("+(10*(i-minTemp)+15)+", "+190+")rotate(-90)")
                .text(function(d) { return i; });
        }
    };

}

window.onload = function(){
    colors();
};

